import React from 'react';
import logo from './logo.svg';
import './App.css';

function openNavBar() {
  return (
    <div class="navBarIcon" onClick={(x) => {x.classList.toggle('change');}}>
      <div class="bar1"></div>
      <div class="bar2"></div>
      <div class="bar3"></div>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <header className="header">
        {openNavBar()}
        <h1>Scheduler</h1>
      </header>
    </div>
  );
}

export default App;
